import styled from "styled-components";

export const LogoImage = styled.img`
  width: 104px;
  /* height: 58px; */
  margin: 24px 128px 16px;
  object-fit: contain;
`;
export const TextSingUp = styled.h1`
  width: 326px;
  height: 18px;
  font-family: Roboto;
  font-size: 20px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: normal;
  letter-spacing: -0.39px;
  text-align: center;
  color: #000;
`;
export const TexfieldLogin = styled.div`
  width: 331px;
  height: 62px;
  margin: 20px 0px 0;
  padding: 0 16px 8px;
`;
export const ButtonLogin = styled.div`
  width: 328px;
  height: 42px;
  padding: 30px 16px;
  border-radius: 2px;
`;
export const LoginFormContainer = styled.div`
  display: grid;
  place-items: center;
`;
export const LoginContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 23rem;
  margin: 16px auto;
  padding: 0 1rem;
  box-sizing: border-box;
`;

export const ButtonCadastro = styled.div`
  margin-top: 1.75rem;
  button {
    color: #000;
  }
`;
